import { Container, Row,Col } from "reactstrap";
import Dashboard from "./layouts/Dashboard";
import JobAdvertisement from "./layouts/JobAdvertisementList";
import Navigation from "./layouts/Navigation";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Navigation />
        </Row>
        <Row>
          <Col xs="3">
             <JobAdvertisement title="JobAdvertisement List"/>
          </Col>
          <Col xs="9">
             <Dashboard />
          </Col>

        </Row>
      </Container>
    </div>
  );
}

export default App;
